webpackJsonp([40652712908768],{4290:function(e,a){e.exports={data:{markdownRemark:{html:'<h2>GameMaker Studio</h2>\n<p>GameMaker Studio, previously known as GameMaker, is a cross-platform game development software primarily focused on creating 2d games\nusing drag and drop action sequences or a scripting language known as Game Maker Language (GML).</p>\n<h3>Overview:</h3>\n<p>GameMaker allows itâ€™s users to create and prototype games quickly without the need to learn a programming language. GameMaker games usually\nconsists of atleast 3 things: sprites (images &#x26; animations), objects (logic &#x26; interactivity) and rooms (screens &#x26; levels).\nEach game needs at least one room which is used for both menus and levels, and the transitioning between each.</p>\n<p>GameMaker Studio 2 released on 2 November 2016. </p>\n<h3>Supported Platforms:</h3>\n<ul>\n<li>Microsoft Windows</li>\n<li>macOS</li>\n<li>Ubuntu</li>\n<li>HTML5</li>\n<li>Android</li>\n<li>iOS</li>\n<li>Windows Phone</li>\n<li>Tizen</li>\n<li>Xbox One</li>\n<li>PlayStation 4</li>\n<li>PlayStation Vita</li>\n</ul>\n<h3>Popular games made with GameMaker Studio:</h3>\n<ul>\n<li>Spelunky</li>\n<li>Hotline Miami</li>\n<li>Hyper Light Drifter</li>\n<li>Crashlands</li>\n<li>VA-11 Hall-A</li>\n</ul>\n<h4>More Information:</h4>\n<ul>\n<li>[Wikipedia] <a href="https://en.wikipedia.org/wiki/GameMaker_Studio">https://en.wikipedia.org/wiki/GameMaker_Studio</a><br></li>\n<li>[YoYo Games (publisher)] <a href="https://www.yoyogames.com/gamemaker">https://www.yoyogames.com/gamemaker</a><br></li>\n<li>[GameMaker: Studio | Documentation] <a href="https://docs.yoyogames.com/">https://docs.yoyogames.com/</a><br></li>\n</ul>',fields:{slug:"/game-development/gamemaker-studio/"},frontmatter:{title:"GameMaker Studio"}}},pathContext:{slug:"/game-development/gamemaker-studio/"}}}});
